import React from "react";
import Navbar from "./Navbar";
import Topseaction from "./Topseaction";
import Table from "./Table";

function Main() {
  const data = [
    {
      name: "Earning",
      amount: "$198K",
      increment: "37.8% this month",
      class: "green",
    },
    {
      name: "Orders",
      amount: "$2.4K",
      increment: "2% this month",
      class: "blue",
    },
    {
      name: "Balence",
      amount: "$2.4K",
      increment: "2% this month",
      class: "aqua",
    },
    {
      name: "Total sale",
      amount: "$89K",
      increment: "11% this week",
      class: "pink",
    },
  ];
  return (
    <div className="main">
      <Navbar />
      <Topseaction />
      <div className="chart">
        <div className="table">
          <div className="tableinside">
            <p className="aline">
              <span>Overview</span>
              <br />
              Monthly Earning
            </p>
            <select>
              <option>Qurataly</option>
              <option>halfyearly</option>
            </select>
          </div>
          <div>table</div>
        </div>{" "}
        <div className="pia">
          <p  className="aline">
            <span>Customer</span>
            <br />
            Customer that buy product
          </p>
          <div>chart</div>
        </div>
      </div>
      <div className="tabledt">
        <div className="all">
          <h2>Prouct Sell</h2>
          <div>
            <input type="search" placeholder="search" />
            <select>
              <option>Last 30 day </option>
              <option>Last 15 day </option>
            </select>
          </div>
        </div>

        <Table />
      </div>
    </div>
  );
}

export default Main;
